import React from 'react';

const Profile = ({user}) => {

    const followingsState = Object.keys(user.Followings).length === 0;
    return (
        <div>
            <p>{user.id}</p>
            <p>{user.nick}</p>
            <p>{user.email}</p>
            <p>
                {
                    followingsState
                    ? 0
                    : Object.keys(user.Followings).length
                }
            </p>
        </div>
    );
};

export default Profile;
